import { Disclosure } from '@headlessui/react'
import '../../css/input.css'

export default function Navbar() {
    return (
        <Disclosure as='nav' className='bg-black'>

            <>
                <div className='mx-auto max-w-9x1 px-2 sm:px-6 lg:px-8 text-white' >
                    <span>Housoku</span>
                </div>

            </>
        </Disclosure>
    )
}
